    return <div class = "element">
      <img src={book.url} alt={book.title} width = "110" height = "150"></img>
      </div>
  })
}

renderScfiBooksList = () => {
return  this.state.scfiBooks.map((book) => {
    return <div class = "element">
      <img src={book.url} alt={book.title} width = "110" height = "150"></img>
      </div>
  })
}

renderGeographyBooksList = () => {
return  this.state.geographyBooks.map((book) => {
    return <div class = "element">
      <img src={book.url} alt={book.title} width = "110" height = "150"></img>
      </div>
  })
}

renderRomansBooksList = () => {
return  this.state.romansBooks.map((book) => {
    return <div class = "element">
      <img src={book.url} alt={book.title} width = "110" height = "150"></img>
      </div>
  })
}

renderHistoryBooksList = () => {
return  this.state.historyBooks.map((book) => {
      return <div class = "element">
      <img src={book.url} alt={book.title} width = "110" height = "150"></img>
      </div>

  })
}

renderUpNav = () => {
        return(  
                    <nav>
                      <a href="http://localhost:3000/">Moje konto</a>
                      <a href="http://localhost:3000/">Mój koszyk</a>
                      <a href="http://localhost:3000/">Zaloguj</a>
                    </nav>                  
            )}
renderHeader = () => {
        return(
                    <div>
                    <p>"KUPUJMY KSIĄŻKI!"</p>
                    </div>)}

renderNav = () => {
        return(
          <div>
            <div></div>
          </div>
        )}




    render() {
        return( 
                  <div id ="header-bloked">
                    <div id = "header">{this.renderUpNav()} </div>
                    <div id = "header-text">{this.renderHeader()}</div>
                    <nav class = "main"><BooksList/></nav>
                  </div>



        )
    }
  }

    export default MainPage;
